import gql from 'graphql-tag'

export const POST_LIST_QUERY = gql`
    query allPosts {
        allPosts {
            title
            content
            userId
            id
        }
    }
`

export const USER_LIST_QUERY = gql`
    query {
        allUsers {
            username
            email
        }
    }
`
